    {   u'broader': [1209],
        u'id': 1211,
        u'labels': [   {   'label': u'middenneolithicum',
                           'language': u'nl',
                           'type': 'prefLabel'}],
        u'matches': {   u'broad': [],
                        u'close': [],
                        u'exact': [],
                        u'narrow': [],
                        u'related': []},
        u'member_of': [],
        u'narrower': [],
        u'notes': [   {   'language': u'nl',
                          'note': u'Te dateren tussen 4300 en 3500 v.Chr. Na de eerste neolithisatiegolf, die grotendeels beperkt bleef tot gebieden met gronden die primitieve landbouw toelieten, zoals de loessgronden van Centraal en West-Europa, volgt een tweede beweging waarin de neolithische leefwijze zich verspreidt over de resterende gebieden van Europa, zoals het Alpengebied en de Atlantische kustzone van (N)W-Europa. Het middenneolithicum is de periode van deze nieuwe golf van neolithisering, ook secundaire neolithisering genoemd. Veruit het belangrijkste kenmerk van de middenneolithische nederzettingen in Centraal- en NW-Europa is de aanleg van imposante omheiningssystemen rond de meestal uitgestrekte \u201cnederzettingen\u201d. Meestal bestaat de omheining uit een of meerdere diepe grachten, gevolgd door aarden wal(len) en palissade(s). E\xe9n van de meest typische kenmerken van het midden-neolithicum in Europa is ongetwijfeld de mijnbouw, naast de megalithische traditie. Een relatief nieuw technologisch gegeven in de middenneolithische maatschappijen, zeker in Noordwest-Europa, is het polijsten niet enkel van harde gesteenten, maar voor het eerst ook van silex. Men gaat over van tribale gemeenschappen naar chiefdom-gemeenschappen met o.a. sociale hi\xebrarchie.',
                          'type': 'definition'},
                      {   'language': u'nl',
                          'note': u'cursusmateriaal UGent (Prof. Ph. Cromb\xe9)',
                          'type': 'note'}],
        u'related': [],
        u'subordinate_arrays': [],
        u'type': u'concept'
        },
